e por sua vez estão em interação constante com o meio. O meio por impor uma resistência constante ao sujeito o faz buscar (conscientemente ou não) a adaptação ao próprio meio. Portanto, a equilibração é um processo psico-biológico que demanda funções e estruturas em buscar constante por adaptação.','2019-06-04 03:20:33','2019-06-04 03:20:33',NULL),(7123,'Unknown','',1,'GNU/Linux','GNU/Linux','Chrome','Chrome 73.0.3683',1,NULL,NULL,NULL,NULL,NULL,'Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/73.0.3683.103 Safari/537.36','127.0.0.1',1,41,8,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2019-06-04 03:20:33','2019-06-04 03:20:33',NULL),(7124,'Unknown','',1,'GNU/Linux','GNU/Linux','Chrome','Chrome 73.0.3683',1,NULL,NULL,NULL,NULL,NULL,'Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/73.0.3683.103 Safari/537.36','127.0.0.1',1,41,26,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2019-06-04 03:20:34','2019-06-04 03:20:34',NULL),(7125,'Unknown','',1,'GNU/Linux','GNU/Linux','Chrome','Chrome 73.0.3683',1,NULL,NULL,NULL,NULL,NULL,'Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/73.0.3683.103 Safari/537.36','127.0.0.1',1,41,32,1,1,1,NULL,NULL,NULL,NULL,'Comite são grupo de pessoas','2019-06-04 03:20:34','2019-06-04 03:20:34',NULL),(7126,'Unknown','',1,'GNU/Linux','GNU/Linux','Chrome','Chrome 73.0.3683',1,NULL,NULL,NULL,NULL,NULL,'Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/73.0.3683.103 Safari/537.36','127.0.0.1',1,41,16,1,NULL,1,NULL,NULL,NULL,322,'Não','2019-06-04 03:20:36','2019-06-04 03:20:36',NULL),(7127,'Unknown','',1,'GNU/Linux','GNU/Linux','Chrome','Chrome 73.0.3683',1,NULL,NULL,NULL,NULL,NULL,'Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/73.0.3683.103 Safari/537.36','127.0.0.1',1,41,32,1,NULL,6,NULL,NULL,NULL,NULL,'São pesquisadores organizados para avaliar aspectos morais da pesquisa a fim de assegurar os direitos dos entrevistad