INSERT INTO `docs` VALUES (1,'Ética em pesquisa com seres humanos: Dignidade e Liberdade','<p>As linhas que seguem s&atilde;o frutos tanto de minha experi&ecirc;ncia em Comit&ecirc; de &Eacute;tica em Pesquisa com Seres Humanos quanto de minha pr&aacute;tica de pesquisa e reflex&atilde;o em Psicologia Moral. Comecemos pela minha experi&ecirc;ncia em Comit&ecirc;s.</p>\r\n\r\n<p>Participei durante alguns anos do Comit&ecirc; de &Eacute;tica em Pesquisa com Seres Humanos da Escola de Educa&ccedil;&atilde;o F&iacute;sica da Universidade de S&atilde;o Paulo e, atualmente, sou membro do Comit&ecirc; do Instituto de Psicologia da mesma universidade. S&atilde;o, ao todo, oito anos de trabalho nessa nova &aacute;rea de atividade acad&ecirc;mica.</p>\r\n\r\n<p>O primeiro depoimento que posso dar &eacute; simples: raros s&atilde;o os casos nos quais os projetos submetidos apresentam problemas &eacute;ticos. Acontecem, &eacute; verdade, algumas situa&ccedil;&otilde;es mais delicadas, para as quais chamamos os pesquisadores para maiores explica&ccedil;&otilde;es e avalia&ccedil;&otilde;es. Mas tal n&atilde;o &eacute; a regra, &eacute; a exce&ccedil;&atilde;o. N&atilde;o quero dizer com esse depoimento que os comit&ecirc;s n&atilde;o t&ecirc;m real utilidade, pois basta um caso eticamente problem&aacute;tico para justificar a sua exist&ecirc;ncia. Mas o fato &eacute; que, felizmente, na maioria das vezes, os projetos n&atilde;o apresentam real problema ou at&eacute; mesmo n&atilde;o apresentam problema algum. O fen&ocirc;meno se deve tanto aos devidos cuidados tomados pelos autores dos projetos, quanto ao fato de muitas pesquisas, notadamente na &aacute;rea da Psicologia, serem totalmente an&oacute;dinas do ponto de vista do risco poss&iacute;vel de ferir, f&iacute;sica ou psicologicamente, os sujeitos de pesquisa (entrevistas, question&aacute;rios, observa&ccedil;&otilde;es, pequenas tarefas sens&oacute;rio-motoras, etc.).</p>\r\n\r\n<p>Em compensa&ccedil;&atilde;o, dois temas outros recorrentemente voltam &agrave; baila. &Eacute; o meu segundo depoimento: n&atilde;o raramente se discute se o Comit&ecirc; de &Eacute;tica em Pesquisa com Seres Humanos deve, ou n&atilde;o, julgar o m&eacute;rito cient&iacute;fico dos projetos a ele submetido, e n&atilde;o raramente tamb&eacute;m se encontram problemas em rela&ccedil;&atilde;o aos Termos de Consentimento Esclarecido. Falemos um pouco de mais cada tema.</p>\r\n\r\n<p>A maioria dos membros dos Comit&ecirc;s de &Eacute;tica em Pesquisa com Seres Humanos &eacute; formada de professores e esses costumam, por h&aacute;bito profissional, detectar poss&iacute;veis problemas te&oacute;ricos e/ou metodol&oacute;gicos nos projetos que avaliam. Mas uma vez detectados tais problemas, o que fazer no contexto de um Comit&ecirc; de &Eacute;tica? Alguns membros afirmam que o Comit&ecirc; deve apontar os poss&iacute;veis erros e pedir aos pesquisadores que refa&ccedil;am seu projeto. Outros replicam que a tarefa do Comit&ecirc; se restringe a proteger os sujeitos de pesquisa de poss&iacute;veis interfer&ecirc;ncias em seu bem-estar f&iacute;sico e psicol&oacute;gico e, que, logo, fugiria &agrave; sua voca&ccedil;&atilde;o avaliar o m&eacute;rito acad&ecirc;mico do trabalho dos colegas. Esse &uacute;ltimo argumento &eacute; contestado por alguns que alegam que a dimens&atilde;o &eacute;tica da pesquisa &eacute; indissoci&aacute;vel do valor cient&iacute;fico dela. Talvez, respondem seus oponentes, mas se avaliarem o m&eacute;rito cient&iacute;fico dos projetos, os Comit&ecirc;s de &Eacute;tica em Pesquisa com Seres Humanos tornar-se-&atilde;o inst&acirc;ncias todo-poderosas, chamando para si atribui&ccedil;&otilde;es que cabem &agrave;s Comiss&otilde;es de Pesquisa, &agrave;s Ag&ecirc;ncias de Fomento e &agrave;s bancas julgadoras de disserta&ccedil;&otilde;es e teses. Como resolver esse debate?</p>\r\n\r\n<p>As d&uacute;vidas que rondam o emprego do Termo de Consentimento s&atilde;o de outra ordem. Elas freq&uuml;entemente recaem sobre a clareza do texto submetido aos sujeitos de pesquisa: ser&aacute; sempre poss&iacute;vel &ldquo;traduzir&rdquo; uma linguagem t&eacute;cnica em outra facilmente compreens&iacute;vel para leigos? Deixo aos ling&uuml;istas resolverem a quest&atilde;o. Mas h&aacute; duas outras que procurarei equacionar. A primeira &eacute; a conhecida poss&iacute;vel interfer&ecirc;ncia que tal termo pode ter sobre os resultados da pesquisa. Tal interfer&ecirc;ncia est&aacute;, &agrave;s vezes, claramente presente. Por exemplo, os cl&aacute;ssicos experimentos de Stanley Milgram a respeito da tend&ecirc;ncia dos seres humanos a obedecerem a figuras de autoridade teriam sido irrealiz&aacute;veis se os sujeitos tivessem sido avisados do papel ing&ecirc;nuo que deveriam desempenhar. Mesma coisa pode ser dita das investiga&ccedil;&otilde;es que pesquisadores da &aacute;rea de Etologia Humana fazem sobre comportamentos de pessoas que, em hip&oacute;tese alguma, podem saber que est&atilde;o sendo observadas. Reencontramos tamb&eacute;m sistematicamente o problema na &aacute;rea de Psicologia Cl&iacute;nica, pois, como o afirmam os especialistas, dizer aos pacientes que as sess&otilde;es poder&atilde;o ser objeto de publica&ccedil;&atilde;o cient&iacute;fica interfere no pr&oacute;prio andamento do trabalho anal&iacute;tico podendo, notadamente, desvirtu&aacute;-lo e, logo, prejudicar quem foi buscar ajuda psicol&oacute;gica. Como decidir, ent&atilde;o, se ser&aacute;, ou n&atilde;o, ou quando ser&aacute;, ou n&atilde;o, submetido ao sujeito de pesquisa o referido Termo? A segunda quest&atilde;o incide sobre a viabilidade de certas pesquisas, notadamente as realizadas com crian&ccedil;as e adolescentes: nesse caso, por serem menores de idade, s&atilde;o os seus pais (ou tutores) que devem assinar o Termo de Consentimento. Por&eacute;m, na pr&aacute;tica, verifica-se que, freq&uuml;entemente, pais demoram em retornar o Termo, seja porque esqueceram de assin&aacute;-lo, seja porque seus filhos esqueceram de entreg&aacute;-los, seja ainda porque ele foi, em algum momento, perdido. Cabe a pergunta: quando uma pesquisa emprega m&eacute;todo evidentemente an&oacute;dino, a exig&ecirc;ncia da assinatura de um Termo de Consentimento n&atilde;o ser&aacute; apenas um ato &ldquo;burocr&aacute;tico&rdquo;, que mais pode atrapalhar que ajudar, e n&atilde;o ato genuinamente &eacute;tico?</p>',1,1,'2018-09-12 12:56:08','2018-09-12 12:56:08'),(3,'Titulo Para teste','<p><strong>Titulo de Texto&nbsp;</strong></p>\r\n\r\n<p>Route groups allow you to share route attributes, such as middleware or namespaces, across a large number of routes without needing to define those attributes on each individual route. Shared attributes are specified in an array format as the first parameter to the&nbsp;<code>Route::group</code>&nbsp;method.</p>\r\n\r\n<h3>Middleware</h3>\r\n\r\n<p>To assign middleware to all routes within a group, you may use the&nbsp;<code>middleware</code>&nbsp;method before defining the group. Middleware are executed in the order they are listed in the array:</p>',0,26,'2019-02-26 05:59:36','2019-02-26 05:59:36'),(4,'O Construtivismo','<p><strong>O construtivismo e sua fun&ccedil;&atilde;o educacional</strong><a href=\"http://www.ufrgs.br/psicoeduc/piaget/o-construtivismo-e-sua-funcao-educacional#nota1\">&sup1;</a><a name=\"volta1\"></a></p>\r\n\r\n<p>Meu objetivo neste texto &eacute; caracterizar construtivismo, dando &ecirc;nfase a sua fun&ccedil;&atilde;o educacional. Para isso, adotarei primeiro o procedimento de contrast&aacute;-lo com uma vis&atilde;o n&atilde;o construtivista do conhecimento. Parto do pressuposto que construtivismo e n&atilde;o construtivismo correspondem a duas vis&otilde;es opostas, isto &eacute;, complementares e irredut&iacute;veis. Por isso, pode-se, ainda que de forma caricata, analisar as caracter&iacute;sticas de um e outro, tal que seja poss&iacute;vel, muitas vezes dizermos para n&oacute;s mesmos quando estamos sendo construtivistas ou adotando um procedimento consistente com esta posi&ccedil;&atilde;o sobre a aquisi&ccedil;&atilde;o do conhecimento.</p>\r\n\r\n<p>Como estudioso da teoria de Piaget e suas aplica&ccedil;&otilde;es escolares ou psicopedag&oacute;gicas, tenho sido freq&uuml;entemente procurado por profissionais que trabalham nestas &aacute;reas para responder a estas perguntas: O que &eacute; construtivismo? Como e por que ser construtivista? Aqui, estas ser&atilde;o meu mote. Mas, antes, devo advertir ao leitor que n&atilde;o tenho forma&ccedil;&atilde;o filos&oacute;fica e que meu construtivismo reduz-se &agrave; vers&atilde;o que lhe deu Piaget, tal como pude, ai de mim, assimil&aacute;-la.</p>\r\n\r\n<p>Se construtivismo e n&atilde;o construtivismo correspondem a vis&otilde;es opostas de conhecimento, no m&iacute;nimo duas tarefas nos s&atilde;o dadas: analisar sua irredutibilidade e sua complementaridade. &Eacute; isso que proponho ao leitor acompanhar nos dois pr&oacute;ximos itens, pois no terceiro e &uacute;ltimo analiso alguns aspectos do construtivismo na escola.</p>',0,45,'2019-03-20 06:30:16','2019-03-20 06:30:16'),(5,'Aprendizagem em Rede vIRTUAL','<p><strong>O construtivismo e sua fun&ccedil;&atilde;o educacional</strong><a href=\"http://www.ufrgs.br/psicoeduc/piaget/o-construtivismo-e-sua-funcao-educacional#nota1\">&sup1;</a><a name=\"volta1\"></a></p>\r\n\r\n<p>Meu objetivo neste texto &eacute; caracterizar construtivismo, dando &ecirc;nfase a sua fun&ccedil;&atilde;o educacional. Para isso, adotarei primeiro o procedimento de contrast&aacute;-lo com uma vis&atilde;o n&atilde;o construtivista do conhecimento. Parto do pressuposto que construtivismo e n&atilde;o construtivismo correspondem a duas vis&otilde;es opostas, isto &eacute;, complementares e irredut&iacute;veis. Por isso, pode-se, ainda que de forma caricata, analisar as caracter&iacute;sticas de um e outro, tal que seja poss&iacute;vel, muitas vezes dizermos para n&oacute;s mesmos quando estamos sendo construtivistas ou adotando um procedimento consistente com esta posi&ccedil;&atilde;o sobre a aquisi&ccedil;&atilde;o do conhecimento.</p>\r\n\r\n<p>Como estudioso da teoria de Piaget e suas aplica&ccedil;&otilde;es escolares ou psicopedag&oacute;gicas, tenho sido freq&uuml;entemente procurado por profissionais que trabalham nestas &aacute;reas para responder a estas perguntas: O que &eacute; construtivismo? Como e por que ser construtivista? Aqui, estas ser&atilde;o meu mote. Mas, antes, devo advertir ao leitor que n&atilde;o tenho forma&ccedil;&atilde;o filos&oacute;fica e que meu construtivismo reduz-se &agrave; vers&atilde;o que lhe deu Piaget, tal como pude, ai de mim, assimil&aacute;-la.</p>\r\n\r\n<p>Se construtivismo e n&atilde;o construtivismo correspondem a vis&otilde;es opostas de conhecimento, no m&iacute;nimo duas tarefas nos s&atilde;o dadas: analisar sua irredutibilidade e sua complementaridade. &Eacute; isso que proponho ao leitor acompanhar nos dois pr&oacute;ximos itens, pois no terceiro e &uacute;ltimo analiso alguns aspectos do construtivismo na escola.</p>\r\n\r\n<p>Para um contraste entre construtivismo e n&atilde;o construtivismo</p>\r\n\r\n<p>1. O construtivismo valoriza as a&ccedil;&otilde;es, enquanto opera&ccedil;&otilde;es do sujeito que conhece.</p>\r\n\r\n<p>Vis&otilde;es n&atilde;o construtivistas do conhecimento valorizam a transmiss&atilde;o, sendo, por isso mesmo, a linguagem seu instrumento mais primoroso. N&atilde;o poderia ser diferente. Quando uma pessoa ou uma comunidade sup&otilde;e ter produzido, n&atilde;o importa se pela experi&ecirc;ncia ou reflex&atilde;o, um conhecimento sobre alguma coisa e julgam que &eacute; importante transmiti-lo para algu&eacute;m que &ndash; por hip&oacute;tese &ndash; n&atilde;o possui este conhecimento, fazem-no pela via da linguagem. Esta &eacute;, de fato, o recurso mais poderoso, econ&ocirc;mico e anal&oacute;gico que conhecemos para compartilhar com algu&eacute;m algo que, por n&atilde;o ter participado de sua hist&oacute;ria, ele s&oacute; pode lhe ter acesso por via indireta &Eacute; poderoso porque nos transporta para um espa&ccedil;o e tempo desconhecidos para n&oacute;s; porque nos faz pensar, tirar conclus&otilde;es, rever pontos de vista; porque dado seu car&aacute;ter irrevers&iacute;vel, certos acontecimentos s&oacute; podem ser &ldquo;revividos&rdquo; pela via da linguagem, etc. &Eacute; econ&ocirc;mico porque sintetiza nas imagens que produz em n&oacute;s algo que, na sua ocorr&ecirc;ncia foi muito longo e cheio de detalhes que podem ser omitidos. &Eacute; anal&oacute;gico porque por interm&eacute;dio de B produz algo que at&eacute; ent&atilde;o s&oacute; tinha exist&ecirc;ncia em A. Consideremos a &uacute;ltima viagem Parati-Ant&aacute;rtida-Parati, de quase dois anos, que fez nosso navegador solit&aacute;rio Amir Klink. Chamamos de &lsquo;A&rsquo; esta sua experi&ecirc;ncia. S&oacute; por interm&eacute;dio de &lsquo;B&rsquo;, isto &eacute;, via fotos, narrativa, descri&ccedil;&atilde;o, etc, poderemos nos apropriar disso que antes s&oacute; ele possu&iacute;a.</p>\r\n\r\n<p>N&atilde;o se trata, pelo considerado acima, de condenar a linguagem, repito, melhor ou as vezes &uacute;nico meio de dispormos de certas informa&ccedil;&otilde;es. O problema &eacute; o lugar que ela ocupa na produ&ccedil;&atilde;o de um conhecimento. Na perspectiva n&atilde;o construtivista seu lugar &eacute; o mais importante. Ao construtivismo interessam as a&ccedil;&otilde;es do sujeito que conhece. Estas, organizadas enquanto esquemas de assimila&ccedil;&atilde;o, possibilitam classificar, estabelecer rela&ccedil;&otilde;es, etc, sem o que aquilo que, por exemplo, se fala ou se escreve para algu&eacute;m n&atilde;o tem sentido para ele. Ou seja, o que importa &eacute; a a&ccedil;&atilde;o de ler ou interpretar o texto e n&atilde;o apenas aquilo que, por ter-se tornado linguagem. pode por ele ser transmitido. Mas, insisto n&atilde;o basta isso.</p>\r\n\r\n<p>2. O construtivismo produz conhecimento em uma perspectiva n&atilde;o formal ou, se se quiser, apenas formalizante.</p>\r\n\r\n<p>Uma vis&atilde;o n&atilde;o construtivista do conhecimento &eacute;, necessariamente, formalizada. Se nele h&aacute; considera&ccedil;&otilde;es de conte&uacute;do, este s&oacute; interessa enquanto exemplo ou descri&ccedil;&atilde;o de algo, que possa, cada vez mais, ser abstra&iacute;do de seu contexto. Ou seja, a forma tende a se tornar independente do conte&uacute;do. Exemplo disso temos nas cl&aacute;ssicas frases das cartilhas A maioria delas corresponde a algo sem sentido, porque provavelmente jamais a ouvir&iacute;amos em um di&aacute;logo reais entre duas crian&ccedil;as ou mesmo adultos. O autor da cartilha sabe disso. Mas, sentiu-se, talvez, autorizado a escrev&ecirc;-las porque quis valorizar, por exemplo, a forma&ccedil;&atilde;o sil&aacute;bica &lsquo;va, ve, vi, va, vu&rsquo;, recorrendo a um conte&uacute;do qualquer para pratic&aacute;-la. A produ&ccedil;&atilde;o construtivista do conhecimento &eacute; formalizante, mas n&atilde;o formalizada. Nela, forma e conte&uacute;do, ainda que n&atilde;o confundidos, s&atilde;o indissoci&aacute;veis Da&iacute;, por exemplo, preferir-se na aprendizagem da leitura e escrita da crian&ccedil;a trabalhar a partir do nome dela ou de textos que tenham sentido ou valor funcional em sua cultura.</p>\r\n\r\n<p>Poder-se-ia repetir as considera&ccedil;&otilde;es acima, por interm&eacute;dio de outros dois termos: tematiza&ccedil;&atilde;o e paradigma. A vis&atilde;o n&atilde;o construtivista de conhecimento opera por paradigmas e seus casos exemplares. A construtivista por um trabalho constante de reconstitui&ccedil;&atilde;o ou tematiza&ccedil;&atilde;o (o que exige descentra&ccedil;&atilde;o e coordena&ccedil;&atilde;o dos diferentes pontos de vista, ent&atilde;o produzidos). Como nos mostrou Piaget (1974a e 1974b), os meios ou esquemas de a&ccedil;&atilde;o que utilizamos para produzir um resultado em fun&ccedil;&atilde;o de um objetivo quando de sua constitui&ccedil;&atilde;o mobilizam todo um trabalho de regula&ccedil;&atilde;o (Piaget, 1977). Nesta fase, os meio s&atilde;o os pr&oacute;prios fins. Mal estes instrumentos coordenam-se entre si, por um complexo processo de assimila&ccedil;&atilde;o e acomoda&ccedil;&atilde;o rec&iacute;procas (Piaget, 1936) neste quaterno (objetos espa&ccedil;o tempo e causalidade ou implica&ccedil;&atilde;o entre a&ccedil;&otilde;es) sem o qual algo n&atilde;o existe (Piaget, 1937), assumem sua eterna e infinita fun&ccedil;&atilde;o de serem meios para outros fins Ou seja, todo esquema de a&ccedil;&atilde;o tem fun&ccedil;&atilde;o instrumental. Tomemos apenas dois exemplos. Quando a crian&ccedil;a aprende a engatinhar seus esfor&ccedil;os de regula&ccedil;&atilde;o concentram-se nesta dif&iacute;cil arte de coordenar entre si bra&ccedil;os, pernas, outras partes do corpo, tal que este movimento (minimamente ajustado no espa&ccedil;o de suas posturas e no tempo de suas mudan&ccedil;as de estado) possa ocorrer. Nesta fase, v&ecirc;-se que todos os esfor&ccedil;os da crian&ccedil;a concentram-se no aprender a engatinhar. Mal ela o consegue volta-se para os &lsquo;novos&rsquo; ob&iexcl;etos (uma m&atilde;e que teima em se afastar dela, um cachorrinho, uma bola interessante, mas distante,) utilizando o engatinhar como instrumento de aproxima&ccedil;&atilde;o ou afastamento deles. Quando se aprende a escrever &ndash; e para muitos esta tarefa demora anos &ndash; todos os esfor&ccedil;os concentram-se em dominar seus &lsquo;segredos&rsquo;. Mal se aprende a escrever e &eacute; o bilhete ou carta que nos toma toda a aten&ccedil;&atilde;o. Ora, tematizar um esquema de a&ccedil;&atilde;o, tendo ele sido apenas meio ou instrumento de outras a&ccedil;&otilde;es ou acontecimentos, implica em inverter esta situa&ccedil;&atilde;o. Agora, tem-se que reconstitu&iacute;-lo, transform&aacute;-lo, tomar consci&ecirc;ncia de suas caracter&iacute;sticas, do qu&atilde;o bem ou mal ele cumpre suas fun&ccedil;&otilde;es, significa critic&aacute;-lo, transform&aacute;-lo, assumir suas conseq&uuml;&ecirc;ncias, etc. Tematizar &eacute;, por isso, reconstruir em um n&iacute;vel superior aquilo que j&aacute; realizamos em outro n&iacute;vel. Tematizar &eacute; construir um novo conhecimento, para um velho e ignorado saber, reduzido a sua boa ou m&aacute; fun&ccedil;&atilde;o instrumental.</p>\r\n\r\n<p>Outra coisa &eacute; o paradigma e seus casos exemplares. Na tematiza&ccedil;&atilde;o a exig&ecirc;ncia &eacute; a da demonstra&ccedil;&atilde;o, da reconstitui&ccedil;&atilde;o e transforma&ccedil;&atilde;o de algo j&aacute; sabido. No paradigma &eacute; o modelo ou padr&atilde;o, gra&ccedil;as ao qual reproduzimos algo dentro de certas condi&ccedil;&otilde;es, repetindo um resultado esperado ou exigido. Para isso, tem-se os casos exemplares, ou seja situa&ccedil;&otilde;es &lsquo;concretas&rsquo; (ainda que n&atilde;o necessariamente vividas por n&oacute;s) ricas de &lsquo;conte&uacute;dos&rsquo; formatados conforme o paradigma, pelas quais podemos entend&ecirc;-lo. N&atilde;o nos espanta, por isso, que na aprendizagem da leitura e escrita pela via n&atilde;o construtivista a c&oacute;pia de frases, palavras ou letras sem sentido para a crian&ccedil;a ser um dos instrumentos mais usados. Por outro lado, como trabalhos complementares, tematiza&ccedil;&atilde;o e paradigma s&atilde;o como duas faces de uma mesma moeda. As crian&ccedil;as, todos n&oacute;s, mal tematizamos alguma coisa j&aacute; a tratamos como um paradigma ou um &lsquo;bom exemplo&rsquo; a ser seguido ou evitado por n&oacute;s ou nossos amigos.</p>',1,1,'2019-03-27 23:20:26','2019-03-27 23:20:26'),(6,'Outro teste Importsante','<p>Outra coisa &eacute; o paradigma e seus casos exemplares. Na tematiza&ccedil;&atilde;o a exig&ecirc;ncia &eacute; a da demonstra&ccedil;&atilde;o, da reconstitui&ccedil;&atilde;o e transforma&ccedil;&atilde;o de algo j&aacute; sabido. No paradigma &eacute; o modelo ou padr&atilde;o, gra&ccedil;as ao qual reproduzimos algo dentro de certas condi&ccedil;&otilde;es, repetindo um resultado esperado ou exigido. Para isso, tem-se os casos exemplares, ou seja situa&ccedil;&otilde;es &lsquo;concretas&rsquo; (ainda que n&atilde;o necessariamente vividas por n&oacute;s) ricas de &lsquo;conte&uacute;dos&rsquo; formatados conforme o paradigma, pelas quais podemos entend&ecirc;-lo. N&atilde;o nos espanta, por isso, que na aprendizagem da leitura e escrita pela via n&atilde;o construtivista a c&oacute;pia de frases, palavras ou letras sem sentido para a crian&ccedil;a ser um dos instrumentos mais usados. Por outro lado, como trabalhos complementares, tematiza&ccedil;&atilde;o e paradigma s&atilde;o como duas faces de uma mesma moeda. As crian&ccedil;as, todos n&oacute;s, mal tematizamos alguma coisa j&aacute; a tratamos como um paradigma ou um &lsquo;bom exemplo&rsquo; a ser seguido ou evitado por n&oacute;s ou nossos amigos.</p>\r\n\r\n<p>3. No construtivismo o conhecimento &eacute; concebido como um tornar-se antes de um ser.</p>\r\n\r\n<p>A vis&atilde;o n&atilde;o construtivista do conhecimento &eacute; ontol&oacute;gica. Ou seja, parte-se de algo cuja exist&ecirc;ncia j&aacute; est&aacute; minimamente constitu&iacute;da como objeto a ser conhecido. Da&iacute; sua pretens&atilde;o descritiva ou explicativa do conhecimento como um &ldquo;&eacute;&rdquo;. Ora, no construtivismo o conhecimento s&oacute; pode ter o estatuto da correspond&ecirc;ncia, da equival&ecirc;ncia e n&atilde;o da identidade (Piaget, 1980). Por isso, o conhecimento s&oacute; pode ser visto como um &ldquo;tornar-se&rdquo; e n&atilde;o como um &ldquo;ser&rdquo;. Em uma perspectiva adulta, formal, j&aacute; constitu&iacute;da (ainda que em constante reformula&ccedil;&atilde;o), sabemos, por exemplo, que h&aacute; um conhecimento sobre leitura e escrita a ser transmitido. Trata-se de um conhecimento socialmente produzido e acumulado, cuja transmiss&atilde;o precisa ser feita ou repetida naqueles que ainda n&atilde;o sabem ler ou escrever. Ora, em uma perspectiva &ldquo;infantil&rdquo;, informal, ainda n&atilde;o constitu&iacute;da minimamente enquanto tal, a escrita n&atilde;o &eacute;, mas se toma como um sendo para algu&eacute;m: Para este, n&atilde;o se tratar&aacute; de descrever uma forma de ler ou escrever j&aacute; praticada, mas de refazer (ainda que de forma abreviada) esta hist&oacute;ria nele e atrav&eacute;s de a&ccedil;&otilde;es ou objetos (ou dos termos que os representam) que fazem sentido para ele. Assim poder-se-ia dizer que quando &ldquo;nasce&rdquo; um escritor tamb&eacute;m &ldquo;nasce&rdquo; uma escrita, quando &ldquo;nasce&rdquo; um leitor tamb&eacute;m &ldquo;nasce&rdquo; um texto, mesmo que, para outros, estes (o texto e a escrita) j&aacute; fossem constitu&iacute;dos.</p>\r\n\r\n<p>Contrastando as duas posi&ccedil;&otilde;es de outro jeito: para o n&atilde;o construtivista a crian&ccedil;a s&oacute; saber&aacute; escrever no final do ano, quando tiver repetido o processo de alfabetiza&ccedil;&atilde;o (ou dominado seus paradigmas); para o construtivista a crian&ccedil;a j&aacute; sabe escrever desde o primeiro dia de aula, ainda que este seu saber conhecer&aacute; muitos aperfei&ccedil;oamentos (no processo de sua necess&aacute;ria tematiza&ccedil;&atilde;o), tal que se torne mais leg&iacute;vel e public&aacute;vel para seu autor ou para um outro.</p>\r\n\r\n<p>4. Ao construtivismo o conhecimento s&oacute; tem sentido enquanto uma teoria da a&ccedil;&atilde;o (em sua perspectiva l&oacute;gico-matem&aacute;tica) e n&atilde;o enquanto uma teoria da representa&ccedil;&atilde;o.</p>\r\n\r\n<p>Como j&aacute; consideramos no item 1, uma vis&atilde;o n&atilde;o construtivista termina por considerar o conhecimento como uma teoria da representa&ccedil;&atilde;o da realidade, n&atilde;o importa se boa ou m&aacute;. Ora, na perspectiva construtivista um conhecimento sobre algo (seja num plano individual, ou coletivo, como se faz em Hist&oacute;ria da Ci&ecirc;ncia, por exemplo), s&oacute; &eacute; poss&iacute;vel enquanto uma teoria da a&ccedil;&atilde;o, da a&ccedil;&atilde;o que produz este conhecimento E nesta teoria interessam, sobretudo, os aspectos l&oacute;gicos e matem&aacute;ticos da a&ccedil;&atilde;o. L&oacute;gicos porque se trata de um sujeito ou uma sociedade constru&iacute;rem ou reconstru&iacute;rem os procedimentos necess&aacute;rios &agrave;quela produ&ccedil;&atilde;o. Sabemos que tanto em termos f&iacute;sicos quanto simb&oacute;licos algo (o gesto de andar ou um texto, por exemplo) s&oacute; acontece se certos instrumentos ou meios forem coordenados no espa&ccedil;o e no tempo, tal que as rela&ccedil;&otilde;es entre seus elementos produzam resultado consistente com um objetivo. A l&oacute;gica expressa este &ldquo;fazer bem&rdquo; da a&ccedil;&atilde;o, isto &eacute;, estas regras de procedimento, esta sintaxe, sem a qual algo n&atilde;o se constitui como um &ldquo;objeto&rdquo; ou acontecimento. Matem&aacute;ticos, porque h&aacute; uma &ldquo;topologia&rdquo;, uma &ldquo;&aacute;lgebra&rdquo;, um &ldquo;grupo de deslocamentos&rdquo; destes estados e posi&ccedil;&otilde;es, sem os quais algo n&atilde;o acontece, nem se constitui. Matem&aacute;ticos porque h&aacute; uma lei de composi&ccedil;&atilde;o, que se repete, que &eacute; estruturante do fen&ocirc;meno que, enquanto tal, s&oacute; se expressa em suas infinitas vers&otilde;es. Ou seja, um engatinhar, enquanto ato, &eacute; sempre diferente de um outro, mas enquanto lei de composi&ccedil;&atilde;o, s&oacute; se constituiu como um &ldquo;X&rdquo;, isto &eacute;, pela eterna troca de estados e posi&ccedil;&otilde;es, por exemplo, entre perna esquerda, bra&ccedil;o direito, perna direita, bra&ccedil;o esquerdo, etc. Esta l&oacute;gica e matem&aacute;tica da a&ccedil;&atilde;o, que produz conhecimento, dependem, como j&aacute; impl&iacute;cito no termo &ldquo;teoria&rdquo;, de uma significa&ccedil;&atilde;o (Piaget, 1946) ou seja, de uma linguagem que possibilita interpretar, dar um sentido a din&acirc;mica de tudo isso. Din&acirc;mica que opera por interm&eacute;dio dos &ldquo;significados&rdquo; que transformam uma a&ccedil;&atilde;o e dos &ldquo;significantes&rdquo;, que conservam os aspectos que a constituem, enquanto algo estruturado e eficaz, ou seja, v&aacute;lido. Neste caso, n&atilde;o se trata de uma linguagem que apenas representa a realidade, mas que constitui ou conserva/transforma os aspectos da a&ccedil;&atilde;o ou do pensamento, que tem valor (a a&ccedil;&atilde;o ou o pensamento) de conhecimento Decorre disso que em uma perspectiva construtivista produz-se interpreta&ccedil;&otilde;es sobre a realidade e n&atilde;o fatos (posi&ccedil;&atilde;o n&atilde;o construtivista). Estas interpreta&ccedil;&otilde;es, pouco a pouco na hist&oacute;ria de sua constru&ccedil;&atilde;o tanto te&oacute;rica quanto metodol&oacute;gica, convergem para algo comum e p&uacute;blico, isto &eacute;, em condi&ccedil;&otilde;es iguais, consentidas por todos. O conhecimento cient&iacute;fico (Piaget, 1967) &eacute;, em muitos casos, um bom exemplo disso.</p>\r\n\r\n<p>5. O construtivismo &eacute; produto de uma a&ccedil;&atilde;o espont&acirc;nea ou apenas desencadeada, mas nunca induzida.</p>\r\n\r\n<p>Para encerrarmos estas considera&ccedil;&otilde;es sobre &ldquo;o que &eacute; construtivismo&rdquo;, talvez seja bom analisarmos a mais dif&iacute;cil de suas exig&ecirc;ncias. Exig&ecirc;ncia esta que o separa definitivamente de um n&atilde;o construtivismo S&oacute; a a&ccedil;&atilde;o espont&acirc;nea do sujeito, ou apenas nele desencadeada, tem sentido na perspectiva construtivista. Esta &eacute; a ess&ecirc;ncia do &ldquo;m&eacute;todo cl&iacute;nico&rdquo; de Piaget (1926), t&atilde;o citado quanto incompreendido: saber ouvir ou desencadear na crian&ccedil;a s&oacute; aquilo que ela possui como patrim&ocirc;nio de sua conduta, como teoria de sua a&ccedil;&atilde;o, como esquema assimilativo. Ora, em uma vis&atilde;o n&atilde;o-construtivista a a&ccedil;&atilde;o induzida &eacute;, muitas vezes, a mais freq&uuml;ente.</p>\r\n\r\n<p>Para uma completitude entre construtivismo e n&atilde;o construtivismo</p>\r\n\r\n<p>Adotamos o procedimento de analisar construtivismo e n&atilde;o construtivismo como duas formas opostas e, por isso, irredut&iacute;veis de conhecimento. Em fazendo assim temos, tamb&eacute;m, que conceb&ecirc;-los como complementares e fundamentais. O problema &eacute; saber quando ou como operar um ou o outro. Sabemos que a s&iacute;ntese, a f&oacute;rmula ou paradigma &eacute; t&atilde;o necess&aacute;rios para a crian&ccedil;a quanto a an&aacute;lise dos meios que produzem este resultado. Ou seja, construtivismo e n&atilde;o construtivismo s&atilde;o duas formas de produ&ccedil;&atilde;o de conhecimento O problema &eacute; diferenci&aacute;-las e integr&aacute;-las; &eacute; saber, repito, quando e como oper&aacute;-los em proveito da educa&ccedil;&atilde;o da crian&ccedil;a.</p>',1,1,'2019-03-28 09:07:15','2019-03-28 09:07:15'),(9,'Introdução','<p style=\"text-align:justify;\">Este texto tem como objetivo servir como guia para auxiliá-lo na organização e escrita de sua tese ou dissertação, ajudando-lhe a melhor compreender como deve ser estruturado o documento e assim sistematizar seu processo de escrita. Frequentemente lembro-me do período em que eu mesmo precisava concluir minha tese, os momentos de ansiedade que dificultavam ainda mais o avanço na composição do documento. A escrita de diferentes partes do texto, em paralelo, em certo momento precisou dar lugar para uma escrita mais sistemática e linear. Com vistas a auxiliá-lo no seu próprio processo de escrita, este capítulo explica como deve ser composto cada capítulo de uma dissertação de mestrado ou tese de doutorado, esclarecendo também algumas questões.</p><p style=\"text-align:justify;\">Iniciando pela definição do que é uma tese, Rüger (2016) descreve o documento como uma monografia escrita por um único indivíduo que: (a) identifica um tema de pesquisa relevante; (b) revisa abordagens utilizadas para tratá-lo; (c) identifica lacunas no conhecimento existente que dão margem para novas contribuições acadêmicas; (d) propõe solução para o problema delineado; (e) explica e justifica, em um nível suficiente de detalhe, o trabalho desenvolvido.</p><p style=\"text-align:justify;\">A tese é, portanto, um documento formal cujo objetivo é apresentar conhecimento novo produzido a partir de pesquisa em determinada área de conhecimento. Seu tema de pesquisa deve ser relevante e não deve ter sido investigado anteriormente por outros pesquisadores utilizando a mesma abordagem.</p><p style=\"text-align:justify;\"><strong>Estrutura da tese&nbsp;</strong></p><p style=\"text-align:justify;\">Esta seção apresenta a estrutura de uma tese, focando apenas em seus elementos textuais , como ilustrado na <strong>Figura 1</strong>. Nas próximas subseções a organização de cada um destes elementos é descrita e comentada.</p><figure class=\"image\"><img src=\"https://scontent.fpoa8-2.fna.fbcdn.net/v/t1.0-9/54524314_2107905765996841_6995458245699567616_n.jpg?_nc_cat=104&amp;_nc_ht=scontent.fpoa8-2.fna&amp;oh=fc69f00f2d3cbf80b120fc987e5d6d13&amp;oe=5D48F8B6\" alt=\"Figura1\"></figure><p style=\"text-align:justify;\">&nbsp;</p><p style=\"text-align:justify;\"><strong>Introdução</strong></p><p style=\"text-align:justify;\">As normas de Vancouver (ICMJE, 2017), apesar de terem sido elaboradas para a área biomédica, sistematizam de maneira concisa o conteúdo que deve compor a introdução de um trabalho para publicação científica. Ela precisa apresentar o contexto do estudo, a natureza do problema tratado e sua relevância. Também deve apresentar claramente o objetivo do trabalho e citar referências importantes para compreensão do contexto de pesquisa proposto. A norma ressalta ainda que dados coletados ou conclusões não devem ser apresentados na Introdução. Em suma, uma boa introdução deve ser capaz de convencer o leitor de que o trabalho é relevante, original e foi desenvolvido com bases teóricas e metodológicas sólidas, sem necessariamente entrar em detalhes de procedimentos metodológicos ou relatar resultados ou conclusões do trabalho. Creswell (2007) propõe um bom modelo para o desenvolvimento da introdução, a partir do qual a lista de sugestões abaixo foi elaborada:</p><p style=\"text-align:justify;\"><strong>O problema de pesquisa:</strong> descreve frequentemente um problema observado no contexto educacional, o qual pode estar relacionado a uma dificuldade de aprendizagem, indicadores inadequados, problemas na formação de professores ou gestão de processos educacionais, etc. Ao apresentar o problema de pesquisa, você situa o leitor com relação ao assunto e às questões que serão abordadas na tese. Você também captura sua atenção por meio de argumentos que mostram como as dificuldades elencadas afetam nosso mundo, e, portanto, demandam esforços para elaboração de uma solução.</p><p style=\"text-align:justify;\"><strong>Estudos que abordam o problema:</strong> comenta soluções já utilizadas no passado para resolver o problema ou alguma situação semelhante. Neste ponto do texto, cite alguns autores para ilustrar trabalhos relacionados, porém não se estenda muito. Lembre que há uma seção mais adiante com este propósito específico.</p><p style=\"text-align:justify;\"><strong>Deficiências nos estudos:</strong> destaca a existência de lacunas no conhecimento que precisam ser preenchidas. Estas lacunas abrem espaço para que novas pesquisas sejam realizadas na área, como por exemplo sua própria tese. Esta breve discussão sobre as deficiências nos estudos existentes também lhe permite posicionar seu trabalho frente aos demais e assegurar o leitor sobre sua originalidade.</p><p style=\"text-align:justify;\"><strong>A declaração de objetivo geral:</strong> em uma única frase, descreve a ideia central da proposta de pesquisa, estabelecendo seu principal propósito.</p><p style=\"text-align:justify;\"><strong>A importância do estudo:</strong> ressalta a relevância de abordar o problema de pesquisa proposto a partir da sua perspectiva, buscando convencer o leitor sobre o interesse no desenvolvimento do estudo. Além destas informações, também é frequente (mas não mandatório) descrever a estrutura dos demais capítulos do documento no final da Introdução.</p><p style=\"text-align:justify;\">Entre os elementos acima listados, é importante examinar com mais atenção a declaração do <i>objetivo geral</i>. Contudo, é necessário inicialmente esclarecer o significado de diferentes termos frequentemente usados na delimitação da pesquisa de uma tese: <i>tema de pesquisa, objetivo geral, objetivos específicos, questões de pesquisa e hipóteses.</i> Não há consenso absoluto sobre a forma como estes termos são utilizados, no entanto, trago uma sugestão baseada em um artigo sobre metodologia de pesquisa em saúde que trata sobre estas definições (Farrugia et al., 2010). A <strong>Figura 2</strong>&nbsp;sugere uma ordem para organização dos termos, do mais genérico ao mais específico.</p><figure class=\"image\"><img src=\"https://scontent.fpoa8-2.fna.fbcdn.net/v/t1.0-9/54433054_2107926959328055_779461256267431936_n.jpg?_nc_cat=106&amp;_nc_ht=scontent.fpoa8-2.fna&amp;oh=529273aae93ac475838aa4fa7056d9e8&amp;oe=5D4A51CF\" alt=\"Figura2\"></figure><p style=\"text-align:justify;\">&nbsp;</p><p style=\"text-align:justify;\"><i><strong>1. Tema de Pesquisa</strong></i></p><p style=\"text-align:justify;\">Em seu livro sobre como escrever uma tese, Eco (2014) afirma que o primeiro impulso de um estudante é propor um <i>tema de pesquisa</i>demasiadamente amplo. Por exemplo:</p><ul><li style=\"text-align:justify;\"><i>- \"Alfabetização e Tecnologia\"</i></li></ul><p style=\"text-align:justify;\"><br>A escolha parece evidente já que o desejo de todo o pesquisador é solucionar grandes desafios da sociedade. Contudo, se pensarmos sobre a abrangência do tema, é fácil perceber que esta definição não explicita aspectos que deveriam estar mais claros: o termo \"tecnologia\" se refere a computadores? Internet? Dispositivos móveis? Aplicativos específicos? A pesquisa abordará questões de aprendizagem? Formação de professores alfabetizadores? Análise de indicadores sobre letramento e tecnologia no país? Você pode perceber, no exemplo, que é necessário delimitar melhor o estudo, especificar detalhes sobre o problema educacional a ser abordado bem como sobre o tipo de solução tecnológica proposto. Reformulado o tema a partir destas considerações, obtém-se uma nova definição:</p><ul><li style=\"text-align:justify;\"><i>- \"Os jogos digitais e a aprendizagem da leitura no Ensino Fundamental\"</i><br>&nbsp;</li></ul><p style=\"text-align:justify;\"><br>Nesta definição do tema de pesquisa, o escopo do estudo parece mais claro do ponto de vista educacional, tecnológico, e também no que diz respeito à relação entre eles. A delimitação adequada do tema de pesquisa também pode nos conduzir para um bom título para a tese. Além de informar o conteúdo da pesquisa de maneira clara, o título deve possibilitar que o texto seja mais facilmente indexado e localizado em futuras buscas por trabalhos relacionados (PEREIRA, 2012).</p><p style=\"text-align:justify;\"><i><strong>2. Objetivo geral</strong></i></p><p style=\"text-align:justify;\">Para a definição do objetivo geral<i>, </i>reduza um pouco mais o escopo da pesquisa com relação ao tema, buscando explicitar o propósito do estudo ainda não apresentado naquela definição. Seguindo nosso exemplo, poderíamos definir como objetivo geral:</p><ul><li style=\"text-align:justify;\"><i>- \"Investigar o potencial dos jogos digitais no apoio à aprendizagem da leitura para crianças no 2o ano do Ensino Fundamental\"</i><br>&nbsp;</li></ul><p style=\"text-align:justify;\"><br>Perceba como o objetivo geral, definido desta forma, explicita a relação que a pesquisa busca elucidar: \"<i>o potencial dos jogos para apoio à aprendizagem da leitura</i>.\" É possível que a declaração de seu objetivo geral se enquadre perfeitamente neste modelo. Contudo, isto pode não ocorrer em função da existência de diferentes tipos de objetivo de pesquisa: explicativo, descritivo, exploratório. O exemplo apresentado ilustra um objetivo de caráter explicativo, para o qual as relações de causa  efeito devem ficar evidentes. Outro exemplo com este tipo de declaração, desta vez oriundo de uma dissertação de mestrado, traz a seguinte definição:</p><ul><li style=\"text-align:justify;\"><i>- \"[...] esta pesquisa visa investigar a influência positiva de gamification no engajamento e desempenho dos estudantes no aprendizado de programação (Da SILVA et al., 2016)\"</i></li></ul><p style=\"text-align:justify;\"><br>Perceba como o autor procurou deixar clara a relação de causa efeito na definição do objetivo da pesquisa, no caso a relação de influência da gamificação no engajamento/desempenho dos estudantes.</p><p style=\"text-align:justify;\">Com relação às pesquisas com características descritivas, a declaração de objetivo geral deve enfatizar o que se busca observar/descrever a partir do estudo proposto, por exemplo:</p><p style=\"text-align:justify;\"><i>\"O objetivo geral da investigação é observar, acompanhar, cartografar e compreender os movimentos que podem ter sido provocados na comunidade escolar em uma escola do campo, de classe multisseriada, localizada no interior da Serra Gaúcha e que foi contemplada com a distribuição de laptops educacionais na modalidade 1:1 pelo Pronacampo (PESCADOR, 2016, p.20)\"</i></p><p style=\"text-align:justify;\">Note a ausência de relação explícita de causa  efeito nesta declaração. Aqui a intenção da pesquisadora foi observar e descrever os processos educacionais decorrentes da distribuição de laptops educacionais em determinada escola.</p><p style=\"text-align:justify;\">Já a definição de um objetivo de caráter exploratório deve discorrer sobre o que será examinado, enfatizando o caráter aberto da pesquisa, sem que se tenha clareza do tipo de resultado que pode advir do estudo. Por exemplo, em uma pesquisa que identificou por meio de técnica de mineração de dados os temas de pesquisa emergentes em publicações na área de Informática na Educação, o propósito do trabalho foi assim definido:</p><p style=\"text-align:justify;\"><i>- \"[...] neste artigo pretende-se fornecer uma visão geral sobre os tópicos de pesquisa emergentes no contexto educacional [...] (BORGES et al., 2015)\"</i></p><p style=\"text-align:justify;\">Pesquisas exploratórias são comumente definidas como estudos preliminares que permitem melhor conhecer determinado tema sobre o qual não se tem muita informação (BABBLE, 1986). Por isso, pesquisas exploratórias na sua íntegra, não são tão frequentes em Informática na Educação. Como seu objetivo é normalmente familiarizar o pesquisador com um fenômeno ou área a ser investigada, a pesquisa de caráter exploratório é mais comum na etapa inicial ou intermediária de um projeto.</p><p style=\"text-align:justify;\"><i><strong>3. Questão de pesquisa</strong></i></p><p style=\"text-align:justify;\">Associada ao objetivo geral, está a questão de pesquisa. Uma primeira alternativa é defini-la na forma de uma pergunta equivalente ao objetivo proposto:</p><ul><li style=\"text-align:justify;\"><i>Qual o potencial dos jogos digitais no apoio à aprendizagem da leitura no 2oano do Ensino Fundamental?</i></li></ul><p style=\"text-align:justify;\">Este formato de definição, contudo, se aproxima muito da maneira como foi declarado o objetivo geral, o que traz certa redundância para as delimitações do estudo. A elaboração de uma questão se faz mais relevante quando reduzir ainda mais a pesquisa, por exemplo:</p><ul><li style=\"text-align:justify;\"><i>Em que medida o emprego do jogo X em contextos educacionais formais com crianças do 2o ano do Ensino Fundamental pode contribuir com o desenvolvimento da aprendizagem da leitura?</i></li></ul><p style=\"text-align:justify;\"><br>Nesta definição, foram especificados aspectos relacionados à tecnologia e também ao contexto educacional no qual será desenvolvida a pesquisa.</p><p style=\"text-align:justify;\"><i><strong>4. Questões de pesquisa</strong></i></p><p style=\"text-align:justify;\">Importante ressaltar aqui a diferença feita entre a QUESTÃO e pesquisa e as QUESTÕES de pesquisa. A questão de pesquisa central do estudo, colocada no singular, pode ser desdobrada em outras questões de pesquisa, no plural, que devem ser delimitadas de maneira ainda mais específica. Estes refinamentos podem envolver: a explicitação dos participantes da pesquisa; o tipo de intervenção que se busca implementar (se houver); o espaço/contexto onde será desenvolvido o estudo; a comparação com grupo de controle ou com dados históricos; o tipo de resultado que se espera obter. Para ilustrar estes detalhamentos, partindo da questão de pesquisa definida em nosso exemplo, podemos pensar em duas questões relevantes:</p><ul><li style=\"text-align:justify;\"><i>Em que medida uma intervenção semanal de 30min com o jogo X pode melhorar o desempenho de crianças do 2o ano do Ensino Fundamental em atividades de leitura quando comparado ao mesmo tipo de atividade realizada com livros impressos?</i><br><br>&nbsp;</li></ul><p style=\"text-align:justify;\">- Participantes: Crianças do 1o ano do Ensino Fundamental</p><p style=\"text-align:justify;\">- Intervenção: <i>- intervenção semanal de 30min com o jogo X</i></p><p style=\"text-align:justify;\">- Comparação: intervenção com jogo comparada a atividade com livro impresso</p><p style=\"text-align:justify;\">- Resultado esperado: melhora do desempenho</p><ul><li style=\"text-align:justify;\"><i>Quais aspectos da intervenção com o jogo X possibilitam que a criança melhore suas habilidades de compreensão textual?</i><br>&nbsp;</li></ul><p style=\"text-align:justify;\">- Participantes: crianças do 1o ano do Ensino Fundamental</p><p style=\"text-align:justify;\">- Intervenção: uso do jogo X</p><p style=\"text-align:justify;\">- Resultado esperado: melhor entendimento sobre fatores que facilitam a compreensão textual</p><p style=\"text-align:justify;\">As duas questões são complementares e requerem métodos de coleta e análise de dados diferentes para serem respondidas. Contudo, ambas fazem parte da pesquisa delimitada pelo objetivo geral e questão de pesquisa.</p><p style=\"text-align:justify;\"><i><strong>5. Objetivos Específicos: Uma alternativa para as questões de pesquisa</strong></i></p><p style=\"text-align:justify;\">Ao invés de definir um conjunto de questões de pesquisa, talvez faça mais sentido para seu trabalho definir objetivos específicos. Estes devem ser contribuições intermediárias da pesquisa que compõem o objetivo geral. Do mesmo modo, você pode estruturá-los identificando inicialmente se têm caráter descritivo, explicativo ou exploratório. Dois ou três objetivos específicos podem ser suficientes para estabelecer metas adequadas para uma tese, as quais devem poder ser verificadas ao final do trabalho: todos os objetivos específicos foram alcançados? Neste sentido, perceba também que os objetivos específicos não devem ser meros passos da sua lista de procedimentos metodológicos, como por exemplo selecionar sujeitos, realizar entrevistas, ou analisar os dados coletados. Os objetivos específicos devem corresponder a contribuições intermediárias da pesquisa, por exemplo:</p><p style=\"text-align:justify;\">- Desenvolver e validar um jogo para apoio à alfabetização que disponha de mecanismos para representar e monitorar o nível de desenvolvimento do aluno no que diz respeito às habilidades de leitura e compreensão textual.</p><p style=\"text-align:justify;\">- Investigar em que medida a utilização do jogo X por crianças do 2o ano do Ensino Fundamental em intervenções semanais por um período de 4 meses pode melhorar o desempenho dos alunos em atividades de leitura quando comparado ao mesmo tipo de atividade realizada com livros impressos</p><p style=\"text-align:justify;\">Note que a produção tecnológica da pesquisa (ferramenta de apoio à aprendizagem da leitura capaz de representar o nível de desenvolvimento do aluno), apresentada no primeiro objetivo, pode ser vista como uma contribuição significativa. O segundo objetivo elencado corresponde a uma das questões definidas em nosso exemplo de projeto, apresentada aqui na forma de uma afirmação. Portanto, é importante perceber como a tentativa de definir tanto objetivos específicos quanto questões de pesquisa em sua tese pode ser contraproducente pela redundância gerada nesta construção.</p><p style=\"text-align:justify;\"><strong>6. </strong><i><strong>Hipóteses</strong></i></p><p style=\"text-align:justify;\">As hipóteses são proposições diretamente relacionadas às questões de pesquisa definidas. A hipótese abaixo foi elaborada a partir da primeira questão de pesquisa elencada para nosso projeto exemplo:</p><ul><li style=\"text-align:justify;\"><i>A utilização do jogo X por crianças do 2o ano do Ensino Fundamental em intervenções semanais de 30min por um período de 4 meses contribui com a melhora do desempenho dos alunos em atividades de leitura quando comparado ao mesmo tipo de atividade realizada com livros impressos.</i></li></ul><p style=\"text-align:justify;\">A definição de hipóteses é mais recomendada para pesquisas de cunho quantitativo que fazem uso de ferramental estatístico de validação. Nestes casos, sugere-se seguir os delineamentos de testes de hipóteses para os quais uma hipótese nula é definida, sendo esta o contrário da proposição que se busca validar. Os testes são construídos visando justamente rejeitar esta hipótese nula. Lapponi (2005) explica em detalhe estes procedimentos e traz exemplos práticos de como elaborar estas definições e realizar os testes de hipóteses.</p>',1,1,'2019-04-27 08:49:21','2019-05-06 20:59:03'),(20,'Escrita da Dissertação/Tese 25','<p><span class=\"text-small\" style=\"font-family:Arial, Helvetica, sans-serif;\"><i><strong>1. Tema de Pesquisa</strong></i></span></p><blockquote><p style=\"text-align:justify;\"><a href=\"globo.com\"><span class=\"text-small\" style=\"font-family:Arial, Helvetica, sans-serif;\">Em seu livro sobre como escrever uma </span></a><span class=\"text-small\" style=\"font-family:Arial, Helvetica, sans-serif;\">tese, Eco (2014) afirma que o primeiro impulso de um estudante é propor um <i>tema de pesquisa</i>demasiadamente amplo. Por <mark class=\"marker-yellow\">exemplo</mark>:</span></p></blockquote><ol><li><span class=\"text-small\" style=\"font-family:Arial, Helvetica, sans-serif;\"><i>\"Alfabetização e <s>Tecnologia</s>\"</i></span></li></ol><p style=\"text-align:justify;\">&nbsp;</p><figure class=\"image image-style-align-left\"><img src=\"https://d2slcw3kip6qmk.cloudfront.net/marketing/discovery/UML_sequence_diagram-700x664.png\" alt=\"Resultado de imagem para uml\"></figure><p style=\"text-align:justify;\"><span class=\"text-small\" style=\"font-family:Arial, Helvetica, sans-serif;\">A escolha parece <mark class=\"marker-pink\">evidente</mark> já que o desejo de todo o pesquisador é solucionar grandes desafios da sociedade. <strong>Contudo</strong>, se <i>pensarmos</i> sobre a abrangência do tema, é fácil perceber que esta definição não explicita aspectos que <mark class=\"marker-yellow\">deveriam</mark> estar mais claros: o termo \"tecnologia\" se refere a computadores? Internet? Dispositivos móveis? Aplicativos específicos? A pesquisa abordará questões de aprendizagem? Formação de professores alfabetizadores? Análise de indicadores sobre letramento e tecnologia no país? Você pode perceber, no exemplo, que é necessário delimitar melhor o estudo, especificar detalhes sobre o problema educacional a ser abordado bem como sobre o tipo de solução tecnológica proposto. Reformulado o tema a partir destas considerações, obtém-se uma nova definição:</span></p><ol><li style=\"text-align:justify;\"><span class=\"text-small\" style=\"font-family:Arial, Helvetica, sans-serif;\"><i>\"Os jogos digitais e a aprendizagem da leitura no Ensino Fundamental\"</i></span></li></ol><p style=\"text-align:justify;\">&nbsp;</p><p style=\"text-align:justify;\"><span class=\"text-small\" style=\"font-family:Arial, Helvetica, sans-serif;\">Nesta definição do tema de pesquisa, o escopo do estudo parece mais claro do ponto de vista educacional, tecnológico, e também no que diz respeito à relação entre eles. A delimitação adequada do tema de pesquisa também pode nos conduzir para um bom título para a tese. Além de informar o conteúdo da pesquisa de maneira clara, o título deve possibilitar que o texto seja mais facilmente indexado e localizado em futuras buscas por trabalhos relacionados (PEREIRA, 2012).</span></p><figure class=\"image\"><img src=\"https://d2slcw3kip6qmk.cloudfront.net/marketing/pages/chart/examples/UML-templates/online-shopping-class-diagram-example.png\" alt=\"Resultado de imagem para uml\"></figure><p><span class=\"text-small\" style=\"font-family:Arial, Helvetica, sans-serif;\">Nesta definição do tema<strong> de pesquisa, o escopo do estudo parece mais claro do ponto de vista educacional, tecnológico, e também no q</strong>ue diz respeito à relação entre eles. A delimitação adequada do tema de pesquisa também pode nos conduzir para um bom título para a tese. Além de informar o conteúdo da pe</span></p>',1,1,'2019-04-27 09:08:38','2019-05-03 03:22:14'),(22,'Meu Material de tese','<p>Para Salles, sem a Cop 25, manter o encontro em Salvador seria uma \"oportunidade\" apenas para a turma \"fazer turismo em Salvador\" e \"comer acarajé\".</p><p>\"Vou manter um encontro que vai preparar um outro, que não vai acontecer mais no Brasil, por quê? Não faz o menor sentido, vai para o Chile! Vou fazer uma reunião para a turma ter oportunidade de fazer turismo em Salvador? Comer acarajé?\", afirmou.</p><p>Perguntado quem seria a \'turma\", ele disse: \"sei lá, o pessoal de sempre\".</p><p>Nos bastidores, o governo federal atribui a organização do evento em Salvador ao ex-ministro do Meio Ambiente, do PV, para \"agradar\" ao partido – que controla a pasta na capital baiana.</p><p>O governo brasileiro cancelou a edição latino-americana e caribenha da Semana do Clima, que ocorreria entre 19 e 23 de agosto em Salvador.</p><p>O encontro, organizado pela Convenção-Quadro das Nações Unidas sobre Mudança do Clima (UNFCCC), é um dos eventos preparatórios da COP 25, que será realizada em dezembro em Santiago.</p>',1,58,'2019-05-14 21:37:24','2019-05-14 21:37:24'),(23,'Direita e Esquerda: Conceitos e Discussão','<p>Mas podemos sempre tentar restaurar alguma objetividade no uso das palavras. “Direita” e “esquerda” se tornaram basicamente armas retóricas da guerra política, mas acredito que podem ter alguma validade descritiva.</p><p>Nisso, sigo o insight básico de <strong>Norberto Bobbio</strong> em “Esquerda e Direita”: a esquerda se define pelo desejo de igualdade, seja no âmbito dos direitos políticos e civis, seja na esfera econômica. Quem está lutando por maior igualdade entre os homens é a esquerda dentro de um dado contexto.</p><p>Não vejo a direita, contudo, como apenas uma força de resistência, de justificação das desigualdades. Há dois valores positivos pelos quais a pessoa que se identifica como direita pode estar lutando. Dois valores distintos que podem se opôr à igualdade e entre si.</p><p>O primeiro é a liberdade individual, e define a direita liberal. Escolhas pessoais, espaço para crescer e construir a própria trajetória na vida, permitir que cada um viva ao máximo possível segundo seus próprios valores, mesmo que isso implique alguma desigualdade.</p><p>O segundo é a ordem, e define a direita conservadora. A sociedade humana, para não desabar no puro caos, precisa de algum tipo de ordenamento e hierarquia. Isso pode vir da religião, da tradição, da moral, da imposição implacável de lei e da ordem.</p>',1,58,'2019-05-14 21:43:48','2019-05-15 00:03:44');
