ticipação direta das crianças nos trabalhos que realizavam. Ajudar a mãe a cuidar das galinhas, da horta ou comida, ajudar ao pai na ordenha das vacas, no cultivo da roça, no traçado da madeira era tão necessário, para eles, quanto as brincadeiras e travessuras, para as crianças. Neste contexto, muitas histórias da própria família, de sua tradição, das coisas boas e más acontecidas, eram contadas e contadas nas muitas versões dos pais, avós, tias, irmãos mais velhos e outros As primeiras letras eram obtidas não raro também graças ao interesse de um pai rico contratando um professor particular ou se servindo das habilidades de uma tia “solteirona” e sabida.',13,13,41,'2019-03-28 09:32:20','2019-03-28 09:32:20',4,0),(101,'Havia um tempo em que casa, oficina e escola ocupavam um mesmo lugar e nelas tudo se fazia e compreendia. As transmissões ou lições de vida dos mais velhos eram tão freqüentes quanto a participação direta das crianças nos trabalhos que realizavam. Ajudar a mãe a cuidar das galinhas, da horta ou comida, ajudar ao pai na ordenha das vacas, no cultivo da roça, no traçado da madeira era tão necessário, para eles, quanto as brincadeiras e travessuras, para as crianças. Neste contexto, muitas histórias da própria família, de sua tradição, das coisas boas e más acontecidas, eram contadas e contadas nas muitas versões dos pais, avós, tias, irmãos mais velhos e outros As primeiras letras eram obtidas não raro também graças ao interesse de um pai rico contratando um professor particular ou se servindo das habilidades de uma tia “solteirona” e sabida. A família era grande e próxima (no amor e no ódio bem como no espaço e no tempo de seus desenlaces).',14,14,41,'2019-03-28 09:34:15','2019-03-28 09:34:15',4,0),(102,'Resposta da melissa',1,1,51,'2019-04-01 13:09:18','2019-04-01 13:09:18',4,0),(103,'Karine, aqui a resposta da melissa',NULL,NULL,51,'2019-04-01 13:09:55','2019-04-01 13:09:55',4,0),(104,'Respostaaaa',2,2,51,'2019-04-01 14:13:54','2019-04-01 14:13:54',