INSERT INTO `resumos` VALUES (1,'Resumo do documento',1,1,'2018-09-12 12:56:08','2018-09-12 12:56:08'),(2,'<p>To assign middleware to all routes within a group, you may use the&nbsp;<code>middleware</code>&nbsp;method before defining the group. Middleware are executed in the order they are listed in the array</p>',26,3,'2019-02-26 05:59:45','2019-02-26 05:59:45'),(3,'<p>N&atilde;o se trata, pelo considerado acima, de condenar a linguagem, repito, melhor ou as vezes &uacute;nico meio de dispormos de certas informa&ccedil;&otilde;es. O problema &eacute; o lugar que ela ocupa na produ&ccedil;&atilde;o de um conhecimento. Na perspectiva n&atilde;o construtivista seu lugar &eacute; o mais importante. Ao construtivismo interessam as a&ccedil;&otilde;es do sujeito que conhece. Estas, organizadas enquanto esquemas de assimila&ccedil;&atilde;o, possibilitam classificar, estabelecer rela&ccedil;&otilde;es, etc, sem o que aquilo que, por exemplo, se fala ou se escreve para algu&eacute;m n&atilde;o tem sentido para ele. Ou seja, o que importa &eacute; a a&ccedil;&atilde;o de ler ou interpretar o texto e n&atilde;o apenas aquilo que, por ter-se tornado linguagem. pode por ele ser transmitido. Mas, insisto n&atilde;o basta isso.</p>',45,4,'2019-03-20 06:30:30','2019-03-20 06:30:30'),(4,'Meu objetivo neste texto é caracterizar construtivismo, dando ênfase a sua função educacional. Para isso, adotarei primeiro o procedimento de contrastá-lo com uma visão não construtivista do conhecimento. Parto do pressuposto que construtivismo e não construtivismo correspondem a duas visões opostas, isto é, complementares e irredutíveis. Por isso, pode-se, ainda que de forma caricata, analisar as características de um e outro, tal que seja possível, muitas vezes dizermos para nós mesmos quando estamos sendo construtivistas ou adotando um procedimento consistente com esta posição sobre a aquisição do conhecimento.',1,5,'2019-03-27 23:20:39','2019-05-03 03:28:30'),(5,'Adotamos o procedimento de analisar construtivismo e não construtivismo como duas formas opostas e, por isso, irredutíveis de conhecimento. Em fazendo assim temos, também, que concebê-los como complementares e fundamentais. O problema é saber quando ou como operar um ou o outro. Sabemos que a síntese, a fórmula ou paradigma é tão necessários para a criança quanto a análise dos meios que produzem este resultado. Ou seja, construtivismo e não construtivismo são duas formas de produção de conhecimento O problema é diferenciá-las e integrá-las; é saber, repito, quando e como operá-los em proveito da educação da criança.',1,6,'2019-03-28 09:07:34','2019-05-03 03:28:03'),(6,'Grandeeee Resumo!! \r\nFazia',1,20,'2019-05-02 21:18:43','2019-05-02 21:18:43'),(7,'correção! \"ramon\" \r\n/\'ramon\r\n{{ramon}} <bold> ramon</bold>',1,9,'2019-05-02 21:58:27','2019-05-02 22:21:27'),(8,'minha sintese1',1,1,'2019-05-06 02:09:03','2019-05-06 02:09:03'),(10,'Vivemos uma verdadeira obsessão classificatória. A etiqueta que você escolhe para descrever suas posições políticas – esquerda, direita, etc. – é tratada como mais relevante do que suas posições políticas. Posso ter posições muito bem definidas sobre todo e qualquer tema relevante da atualidade – privatizações, reformas econômicas, política externa, educação –, mas se eu não tiver escolhido uma etiqueta para me descrever, serei tido como “em cima do muro”, “isentão”. <br> Alternativamente, a pessoa que afirma orgulhosa um rótulo pode ser confusa e genérica em todas as questões, e <b>mesmo</b> assim todos à sua volta acharão que ela tem opiniões fortes.',58,23,'2019-05-15 00:19:53','2019-05-24 17:47:13');
